  }

  return (
    <div>
      <h1>Urls</h1>
      {urls.length !== 0 ? (
        urls.map(url => (
          <div key={url.id}>
            <p>{url.url}</p>
            <button onClick={e => handleClick(url.id)}>Delete</button>
          </div>
        ))
      ) : (
        <p>No urls here!</p>
      )}
    </div>
  )
}

export default UrlsList
